import React from 'react';
import './arbabGroup.css';  // Import the corresponding CSS

function ArbabGroup() {
  return (
    <div className="arbab-group-container">
      <div className="arbab-group-image">
        <img src="/images/arbab-group.jpg" alt="Arbab Group" />
      </div>
      <div className="arbab-group-description">
        <h2>Arbab Group</h2>
        <p>Arbab Group has been a prominent player in the paper converting & flexible packaging industry, offering innovative and customized solutions since 1988. With a strong focus on quality and client satisfaction, we have established a solid reputation in the packaging sector.</p>
      </div>
    </div>
  );
}

export default ArbabGroup;
